import ExpenseItem from './components/ExpenseItem';

function App() {

  const expenses = [
    {
      id: 'e1',
      title: "Car Insurance",
      amount: 434.5,
      date: new Date(2021, 3, 28)
    },
    {
      id: 'e2',
      title: "New Tv",
      amount: 434.5,
      date: new Date(2021, 3, 28)
    },
    {
      id: 'e3',
      title: "Refrigerator",
      amount: 434.5,
      date: new Date(2021, 3, 28)
    },
    {
      id: 'e4',
      title: "Phone",
      amount: 434.5,
      date: new Date(2021, 3, 28)
    },
  ];

  return (
    <div>
      <h2>Let's get started!</h2>
      <ExpenseItem title={expenses[0].title} amount={expenses[0].title} date={expenses[0].date} />
      <ExpenseItem title={expenses[1].title} amount={expenses[1].title} date={expenses[0].date} />
      <ExpenseItem title={expenses[0].title} amount={expenses[0].title} date={expenses[0].date} />
      <ExpenseItem title={expenses[0].title} amount={expenses[0].title} date={expenses[0].date} />
    </div>
  );
}

export default App;
